INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '1',  'Relation of Duality', 1,  'These relations are the most favourable and comfortable of all intertype relations providing complete psychological compatibility. Dual partners are like two halves of a whole unit. They usually understand each others intentions without any need to say a word. Dual will naturally protect your weak points and appreciate the strong ones without asking for anything in return. Interaction with your Dual allows you to be yourself without the need to adjust to your partner like in other relations. This often saves both partners a lot of energy which they can use for their own interesting activities. Conflicts between Duals are very rare and if there are any, they are normally short lived and solved without pain. Your Dual partner will love you just for what you are and if there is such a thing as true love then it could probably only occur in relations of Duality.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '2',  'Identical Relation', 2,  'These are relations of complete understanding between partners but with an inability to help each other. Identical partners see the world with identical eyes, identically work out received information, come to identical conclusions and have identical problems. Identical partners usually experience sympathy towards each other, trying to support and justify each other.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '3',  'Relation of Activity', 3,  'These relations are the easiest and quickest to start. Activity partners do not experience any visual difficulties when starting relations which can be surprising to them at the beginning. Partners stimulate each other into activity. Interaction with an Activity partner becomes really satisfying especially if both partners feel a mutual attraction. However, with continuous interaction over a long period comes overactivation which normally results in an overall tiredness of each other (a good example is when you watch a comedy that is so funny that after half the film you do not have the energy to laugh anymore). When this happens Activity partners need a short rest from each other, after which they can enjoy a positive interaction once again. This pattern repeats itself giving these relations an oscillating character. If partners cannot take a break from each other, it can cause negative stimulation to take the place of positive.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '4',  'Mirror Relation', 4,  'These are relations of mutual correction. Mirror partners have similar interests and ideas, but a slightly different understanding of the same problems. Each partner can see only half of one problem. Therefore the partners always find what the other partner is thinking interesting. Usually partners quickly realise that they are very like-minded.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '5',  'Relation of Semi-Duality', 5,  'These are relations of deficient Duality. Semi-Duality partners usually have no problems in understanding each other or each other''s objectives, at least when these objectives are only on paper. When it comes to fulfilling joint plans, partners often fail to co-operate. The extrovert partner hardly listens to the introvert, concentrating more on the sound of their own voice. However, the introvert partner does not get upset about this and they often seem to find a way to adapt to it. Semi-Duals usually have many topics for conversation and these conversations do not seem to be boring.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '6',  'Comparative Relation', 6,  'These are relations of deceptive similarity. Comparative partners talk about similar things, have similar interests, obey the norms of politeness and hospitality towards each other but they never really show an interest in each others problems. After a while these relations can become boring and stagnant. When comparative partners are on the same level in a hierarchy, they can coexist quite peacefully. Once one partner becomes superior to the other, they may have serious disagreements and conflicts. Comparative partners look at the same questions from very different angles. One partner feels as if the other is in their opinion trying to solve the same problem in an impractical manner. Moreover, partners are not happy to acknowledge each other''s different point of view. This may cause great misunderstandings between partners, especially when applied to methods of working and as a result partners usually try to compromise.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '7',  'Conflicting Relation', 7,  'These are relations of constantly developing conflict. Conflicting relations have the worst compatibility between partners among all other relations. However, it does not seem to be so obvious, especially in the earlier stages of development. Conflicting partners appear rather attractive, interesting and with impressive abilities.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '8',  'Super-Ego Relation', 8,  'These are relations of mutual respect between partners. Super-Ego partners may think of each other as a distant and slightly mysterious ideal. They often show interest in each other''s manners, behaviour and thought composition. Both partners experience a warm feeling towards each other, but for the outsider, these relations may look cold.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '9',  'Quasi-Identical Relation', 9,  'These are relations of major misunderstanding. Quasi-Identical partners can interact with each other in a more or less peaceful manner if both partners are Thinking types. If they are both Feeling types however, they are likely to have an argumentative relationship. Also, as in the other relations, personal attraction can be very crucial to the peacefulness in their relationship. An absence of personal attraction may cause unnecessary internal tension resulting in conflict between partners. However these arguments do not often last long. After both partners have released their internal tension, the Perceiving partner is usually the first to show the initiative in reconciliation.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '10',  'Contrary Relation', 10,  'These are relations of an unstable psychological distance. Both partners experience difficulties in establishing and keeping a stable psychological distance between them. The only chance Contrary partners have to get on together well with each other is if they are left alone. In other cases partners usually compete over their strong sides. The reason for this is when somebody else is present, each partner tries to capture the attention of the listener by showing off their strong side. Contrary partners may like some elements of the other partner''s behaviour. This often helps the partners to begin a more close relationship. However, when they are in company, their interaction can change dramatically. The introvert partner usually becomes distant, relations lose warm feelings and become formal and cautious. Both partners may start regretting that they became too trustful.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '11',  'Illusionary Relation', 11,  'These are relations of growing laziness. There are no other intertype relations that can deactivate partners so much as Illusionary relations. Illusionary partners find it comfortable being relaxed together, discussing different subjects. What one partner is talking about is always interesting, but in order to understand the partner better the other partner needs to force themselves. This difficulty in making an effort also makes achieving goals together almost impossible.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '12',  'Look-a-like Relation', 12,  'These are relations between equal partners which can be called acquaintances rather than friends. There are no visual obstacles in the development of these relations, partners can talk easily almost about anything. Look-a-like partners do not feel any danger from the other partner. The strong sides of the partners are different in the such a way that almost any conversations between them always fall into the area of the confidence of only one of the partners. Look-a-like partners also have similar problems which makes them feel rather sympathetic towards each other instead of being critical of each other''s vulnerabilities.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '13',  'Relation of Benefit', 13,  'These relations are asymmetrical. One partner, called the Benefactor, is always in a more favourable position in respect to the other partner who is known as Beneficiary. The Beneficiary thinks of the Benefactor as an interesting and meaningful person, usually over-evaluating them in the beginning. The Beneficiary can be impressed and delighted by their partner''s behaviour, manners, thoughts and their ability to easily deal with things that the Beneficiary conceives as complicated. When partners are together, the Beneficiary involuntarily starts to ingratiate themselves with the Benefactor, trying to please them without any obvious reason. In the worst cases this starts from little things and then becomes bigger until the Beneficiary realises the foolishness of their situation.' );
INSERT IGNORE INTO intertype_relations (relation_id, name, fitness_order, description) VALUES ( '14',  'Relation of Supervision', 14,  'These relations are also asymmetrical as are relations of Benefit. One partner, called the Supervisor, is always in a more favourable position in respect to the other partner who is known as Supervisee. Relations of Supervision can give the impression that Supervisor is constantly watching every step of the Supervisee. The latter usually feels this control even if the Supervisor does not say or do anything. The explanation for this is that the Supervisee weak point is defenceless against the Supervisor''s strong point. This makes the Supervisee nervous and expect the worse.' );
